import React,{useContext}from 'react';
import { contextData } from './Context';
import { Link } from 'react-router-dom';

export const LabelToppost = () => {
    const[data]=useContext(contextData);

    return (
        <div className='toppost'><h1>Top Post</h1>
            {data.filter((x)=>x.id>3&&x.id<7).map((e)=>{
                return(
                    <Link to={`/${e.category}/${e.id}`} className='link2'> 
                    <div >
                        <img src={e.image}/>
                        <h1>{e.title.slice(0,32)}</h1>
                        <p>{e.content.slice(0,120)}</p>
                        <p><b>{e.category}</b> / {e.date}</p>
                    </div>
                    </Link>
                )
            })}
        <hr className='hrstl4'/>
        </div>
    )
}


